　すみっコぐらし/お弁当箱◎4点ロックふわっとランチボックス☆スケーター(530ml)かわいい/キャラクターグッズ通販☆◆<!-- ★お気に入り--><div class="w280-c"><div class="center-m-0a"><img class="item-oki-bn" alt="キャラクターグッズ通販シネマコレクションのお気に入りリストを確認する" src="http://image.rakuten.co.jp/cinemacollection/cabinet/oki-2.gif"></div></div><!-- ★お気に入りココまで--><!--★削除不可--></span></td></tr></table><br></td></tr></table><br><table cellpadding="0" border="0"><tr><td><table cellpadding="0" border="0"><tr><td><span><!--関連検索キーワード--><div style="width:100%;text-align: center"><h3 style="color:#7f7f7f;">フタがドーム型でおかずがつぶれない!!<br><!--★K-->女子向け/かわいい/お弁当グッズ/キャラクター柄/入園準備</h3><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/商品詳細" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn01.gif" /><div style="color:#7f7f7f;width:90%;margin:0 auto;#efefef solid 1px;padding:10px;text-align: left;">すみっこが落ち着く…サンエックスの控え目キャラクター《すみっこぐらし》のかわいいランチ雑貨シリーズ☆彡<br>こちらはドーム型のフタでふわっとおかずが盛り付けられる【ランチボックス】<br>仕切りも高いのでおかずが片寄りにくいよ♪<br>4点ロック式なので汁もれもしにくい!!<br>もちろん電子レンジ＆食洗機も使用OKだからお手入れも簡単♪<br>丼物やオムライス、サンドイッチなどにぴったり♪<br>海苔やふりかけがふたにつきにくいので見た目もGOOD◎<br>スリムタイプなので女性の方でも片手で持てて食べやすい!!<br>同デザインのいろいろなランチ雑貨あるから揃えちゃおう☆彡<br><br>■サイズ：約186×108×62mm<br>■お弁当箱1/2に入るご飯の量：約1.3杯（約260ml）<br>■容量：530ml<br>【日本製】</div></div><div style="width:100%;text-align: center;"><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/詳細画像" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn02.gif" /><div style="width:100%;margin:0 auto;"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20150122/kcsk-284304.jpg"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20150122/kcsk-284304_2.jpg"></div></div><div style="width:100%;text-align: center;"><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/詳細画像" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn03.gif" /><div style="width:50%;t